    return(
        <>
        <div className="control-1">
            <p>Popular</p>
            <button type="button" className="see-all">
                <p>See More  {" >>"}</p>
            </button>
        </div>
        <div className="banner4-over-card">
            <div className="banner4-card">
                <div className="product-img">
                    <img src="/media/nft1.jpg" alt="..."/> 
                </div>
            </div>
        </div>
        </>
    )
};
export default MainBanner4;
